(2, 'Izlet Rtanj - pešačka tura', 'rtanjbanerT.jpg', 'Uspon na jedan od najpoznatijih i najzahtevnijih vrhova Srbije', '<p class=\"lead\" style=\"font-size: 1.09375rem; font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; letter-spacing: 0.42px; text-align: justify;\">Vodimo vas na<b>&nbsp;najinteresantniji i najintrigantniji vrh u Srbiji&nbsp;–&nbsp;Šiljak!&nbsp;</b>Pešačimo obroncima<b> Rtnja</b>, osvajamo njegove padine, uživamo u&nbsp;prelepom pogledu&nbsp;koji se pomalja svuda oko nas,&nbsp;slušamo&nbsp;legende&nbsp;o njenom nastanku i&nbsp;piramidalnom obliku…</p><p class=\"lead\" style=\"font-size: 1.09375rem; font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; letter-spacing: 0.42px; text-align: justify;\">Marljivi speleolozi otkrili su u ovoj planini&nbsp;17 pećina,&nbsp;mnoge izvore,&nbsp;jame&nbsp;i tačno ispod vrha&nbsp;<b>Šiljak (visine 1565m)</b>&nbsp;šupljinu romboidne osnove, visine 450m, stranica od po 250m i 500m. Slučajnost ili ne,&nbsp;tri najviša vrha Rtnja&nbsp;–<b>&nbsp;Kusak, Baba i Šiljak</b>, povezani zamišljenom linijom, formiraju trougao, grotlo jednog kupastog uzvišenja. Meštani ovih krajeva veruju da je <b>cela planina tvorevina bića sa druge planete</b> i da ta čudesna&nbsp;<b>piramida</b>&nbsp;i danas ima moći da u sebe upije svu negativnu energiju iz okruženja, a da ljude prožima pozitivnim silama, zbog čega je poznata kao i mesto gde se mnogi isceljuju. Rtanj ima nagib strana identičan onom na&nbsp;Piramidi Meseca&nbsp;u Meksiku, kao i uglove koji se poklapaju sa onima na&nbsp;Keopsovoj piramidi.&nbsp;</p><p class=\"lead\" style=\"font-size: 1.09375rem; font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; letter-spacing: 0.42px; text-align: justify;\">Na samom&nbsp;vrhu Šiljak&nbsp;očekuje nas još jedna&nbsp;zanimljivost&nbsp;- <b>ruševine nekadašnje crkve&nbsp;– kapele Svetog Đorđa</b>, koju je 1935. godine uz pomoć 1000 radnika u čast muža, izgradila žena vlasnika rudnika&nbsp;„Rtanj“&nbsp;nakon njegove smrti. Tragači za zlatom u više navrata rušili su ovu kapelu dinamitom.</p><p class=\"lead\" style=\"font-size: 1.09375rem; font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; letter-spacing: 0.42px; text-align: justify;\">&nbsp;Imate li hrabrosti da krenete u&nbsp;<b>avanturu otkrivanja tajni Rtnja</b>?</p>', '<p><b>Dan 1: </b>Pešačenje do vrha Rtnja</p><p><span style=\"font-family: &quot;Segoe UI&quot;;\">﻿</span><span style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\">Polazak je iz Beograda oko 7h ujutru od Muzeja istorije Jugoslavije (Kuća cveća). Vožnja autoputem Beograd – Niš gde kod Paraćina skrećemo dalje ka Boljevcu.&nbsp;</span><span style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\">Stižemo u podnožje planine Rtanj, jednu od najlepših u našoj zemlji i poznatu po bogatstvu biljnih vrsta od kojih se pravi čuveni rtanjski čaj.&nbsp;</span></p><p><span style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\">Pešačkim stazama, južnom stranom, krećemo u osvajanje vrha Šiljak koji, zbog svoje visine (1565m), čini Rtanj gospodarem ovog kraja. Tokom pešačenja, čućemo priču zašto Rtanj nosi oreol mističnosti i o predanju da li je Rtanj planina ili možda piramida ispod koje se krije najstarija tvorevina civilizacije.</span></p><p><span style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\">Povratak u Beograd u kasnim večernjim časovima.</span></p>', '<p style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\">Prilikom prijave plaća se celokupan iznos u dinarskoj protivvrednosti. &nbsp;</p><ul style=\"font-family: -apple-system, BlinkMacSystemFont, Roboto, &quot;Segoe UI&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 14px; letter-spacing: 0.42px;\"><li>Opcije plaćanja:</li><li>Gotovinsko plaćanje</li><li>Plaćanje čekovima</li><li>Plaćanje platnim karticama</li><li>Plaćanje preko računa</li></ul>', '', 'Autobus, Beograd - Boljevac- Beograd', 20, '3', 5, 15, 1, 1),
(3, 'Novi aranzman za brisanje kasnije', 'photo1.jpg', 'ljfjlfjlfsjklfsjlkfsjkljkljklsdfjklsda', '<p>dlklkjdjlkdfsjlkfsdsjlkdff<b>sldjkdfsljkdsfjlkjlkdsf<span style=\"background-color: rgb(57, 123, 33);\">fsafasdfasdfsafasdfas</span></b></p>', '<p>dlklkjdjlkdfsjlkfsdsjlkdff<span style=\"font-weight: bolder;\">sldjkdfsljkdsfjlkjlkdsf<span style=\"background-color: rgb(57, 123, 33);\">fsafasdfasdfsafasdfas</span></span><br></p>', '<p>dlklkjdjlkdfsjlkfsdsjlkdff<span style=\"font-weight: bolder;\">sldjkdfsljkdsfjlkjlkdsf<span style=\"background-color: rgb(57, 123, 33);\">fsafasdfasdfsafasdfas</span></span><br></p>', '<p>dlklkjdjlkdfsjlkfsdsjlkdff<span style=\"font-weight: bolder;\">sldjkdfsljkdsfjlkjlkdsf<span style=\"background-color: rgb(57, 123, 33);\">fsafasdfasdfsafasdfas</span></span><br></p>', 'Avion', 120, '4', 12, 30, 2, 1);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(5, 'Kajak avantura na Dunavu', 'kajakAvanturaT.jpg', 'Spust kajakom, obilazak peščanih plaža i divljih konja', '<p><img src=\"data:image/jpeg;base64,\" style=\"float: left; width: 50%;\" data-filename=\"kajakAvantura2.jpg\" class=\"note-float-left\"><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\"><b><br></b></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\"><b>Iskusite Dunav iz potpuno druge perspektive</b>. Uskočite u kajak, uhvatite veslo u ruke i zaplovite nizvodno Dunavom. Imaćete priliku da vidite živi svet Dunava, bezbroj ptica, skrivenih uvala, čak i peščanih plaza, za koje malo ljudi i zna da postoje. Ostavite trag svojih stopala na belom pesaku dunavskih sprudova. Nije vam potrebno prethodno iskustvo da bi ste veslali kajak i uživali u ovoj avanturi, i naš licencirani vodič će vam pružiti svu potrebnu pomoć i iskustvo da u potpunosti uživate u ovoj avanturi. Klub obezbedjuje svu neohodnu opremu.</span><br></p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Program:</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Polazak u 08.30h<br>Transfer do mesta ulaza (Surduk): 08.30-09.30<br>Opremanje i prolazak 09.30-14.30<br>Ručak pored Dunava: 14.30-16.00 h<br>Povratak za Beograd: 16.00-17.00 h</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Težina: 2/10</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Ukupni troškovi: 30&nbsp;€</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom obuhvaćeno:<br>– Prevoz Beograd – Surduk – Beograd<br>– Licencirani kajak vodič / prevoz i ishrana<br>– Kompletna oprema za kayaking / prsluk, neopren odelo i čarape, kajak, veslo…</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom nije obuhvaćeno:<br>-Osiguranje<br>-lična oprema<br>-hrana</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Oprema:</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">• Poneti sa sobom mali ranac do 30l u kojem treba da imate bar 1,5l vode<br>• Neki energetski bar ili sušeno i koštunjavo voće<br>• Kupaći kostim i peškir<br>• Kačket ili šešir<br>• Kremu za sunčanje (SPF 30 min)<br>• Papuče<br>• Naočare za sunce<br>• Ako neko ima, nije loše poneti kratke rukavice za biciklu ili za teretanu kako bi veslanje bilo ugodnije, jer nekad postoji mogućnost da se napravi mali žulj od veslanja na rukama.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Kondicioni nivo ture: 2/10</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Tehnički nivo ture: 2/10</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">&nbsp;</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prijave na uros61017@its.edu.rs</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prilikom prijavljivanja poslati planinarsku biografiju i scan planinarske kartice najkasnije 4 dana do početka akcije.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">NAPOMENA: <b>Vodič zadržava pravo da ne povede na turu sve koji nemaju adekvatnu obuću i odeću, odgovarajuće osiguranje, kao i plaćenju članarinu za tekuću godinu.</b> Ova tura ima ukupno oko 10 km veslanja.</p>', 'Autobus, Beograd - Surduk - Beograd', 30, '2', 4, 15, 1, 2);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(6, 'Kanjoning Tribuća', '3-Tribuca-6T.jpg', 'Silazak niz najlepši kanjon u Srbiji', '<p><img src=\"data:image/jpeg;base64,\" style=\"\" data-filename=\"3-Tribuca-6.jpg\"></p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Kanjoning</b> je jedan od najmlađih “outdoor” sportova. Kanjoning je tehnička disciplina kojoj je cilj što lakše savladavanje prepreka u nepristupačnim kanjonskim vodenim tokovima. Kretanje kroz kanjon pored hodanja uključuje i penjanje, skakanje, spuštanje niz uže i plivanje.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Kao i većina kanjona u kojima je moguće praktikovati ovu disciplinu u Srbiji, i Tribuća se nalazi u okolini Valjeva. Za Tribuću slobodno možemo reći da je jedan od najlepših kanjona u našoj zemlji.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Sa svojim veličanstvenim vodopadima koji nas konstantno prate na ovoj avanturi, i sami ćete zaključiti zašto je ovaj dragulj poštovan od strane ljubitelja kanjoninga iz zemlje i regiona.</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">PLAN PUTA:</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">07.00 – okupljanje ipsred zgrade BIGZ-a i polazak<br>09.00 – kratka pauza u Valjevu kako bi smo izvršili poslednje pripreme pred aktivnost<br>11.00 – 17.00 – prolazak kroz kanjon i povratak do vozila<br>17.00 Ručak<br>18.30 Polazak za Beograd</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Ukupni troškovi: 90 €</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom obuhvaćeno:<br>– Transfer Beograd – Tribuća – Beograd<br>– Licencirani canyoning vodič<br>– Oprema za canyoning / neopren odela, čarape, kacige, pojas, uže, osmica, dry bag…</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom nije obuhvaćeno:<br>– Osiguranje<br>– Ručak</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Prijave na uros61017@its.edu.rs</b></p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prijave i pitanja direktno na ovaj mail kod vodiča. Maksimalna veličina grupe je 6 učesnika na jednog vodiča. U slučaju da ima više prijavljenih kreće i drugi vodič.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Oprema:</b><br>Kupaći kostim&nbsp;<br>Staru obuću (patike ili planinarske cipele.&nbsp; SUMMIT EXPLORERS obezbeđuje termoizolacione čarape)</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">SUMMIT EXPLORERS će obezbediti neophodnu zaštitnu i tehničku opremu i to: neoprenska odela, čarape, šlemove, alpinističke pojaseve i dr., a vi ponesite laganu trek odeću.</p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\">Prilikom prijavljivanja poslati scan osiguranja, scan potpisane izjave o rizicima i preuzimanju odgovornosti i scan planinarske kartice.</span><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\"><br></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\"><b>NAPOMENA</b>: Vodič zadržava pravo da ne povede na turu sve koji nemaju adekvatnu obuću i odeću za ovu aktivnost, kao i plaćenju članarinu za tekuću godinu. U prijavi napomenite ukoliko nemate tehničkog iskustva u radu na užetu kako bi Vam organizovali dodatni trening i pripremili vas za predstojeću aktivnost.</span><br></p>', 'Autobus', 90, '3', 5, 20, 1, 3);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(7, 'Durmitor / Bobotov kuk (2523m)', 'DurmitorThumbnailT.jpg', 'Uspon na najviši vrh Durmitora', '<p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"DurmitorNovo.jpg\"></p><p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\">Nacionalni park Durmitor, sa svojim vrhovima, prevojima, gorskim jezerima, gustim četinarskim šumama, predstavlja jedan od najlepsih prirodnih celina u okruženju. U ovoj našoj avanturi, popećemo se na Bobotov kuk (2523mnv), najviši vrh Durmitora, obići ledenu pećinu, prošetati obalama Crnog jezera (ako vreme dozvoli i okupati). Sve to uz pomoć iskusnih vodiča, koji će objasniti kako se kreće po obezbeđenim stazama, gelenderima i planinskim prevojima.</span><br></p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Program:</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan I:</b><br>Transfer od Beograda do Žabljaka :17.00-24.00<br>Nocenje</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan II:</b><br>7.00-8.00-Doručak<br>8.00-17.00- Priprema za uspon i uspon na Bobotov kuk<br>17.00-18.00-Odmor<br>18.00- večera i slobodno vreme</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan III</b>:<br>08.00-09.00 Doručak<br>09.00-12.00-Trek oko Crnog jezera<br>13.00-20.00-Povratak za Beograd</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Ukupni troškovi: <b>140 eura</b></p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom obuhvaćeno:<br>-Prevoz Beograd – Žabljak – Beograd<br>-Licencirani UIAA vodič / prevoz, smeštaj i ishrana<br>-Smeštaj na bazi polu pansiona u 1/2</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom nije obuhvaćeno:<br>-Osiguranje<br>-lična oprema<br>-ostali lični troškovi</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Oprema:&nbsp;Poneti sa sobom mali ranac do 30l u kojem treba da imate bar 2l vode, neki energetski bar ili sušeno i koštunjavo voće, trek pantalone, duboke trek cipele , trek štapovi, aktivni veš dugih rukava, polar dukserica, nepromočiva jakna (soft shell), naočare za sunce + krema za sunčanje, šešir ili kačket.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prilikom prijave navedite da li želite da idete sa kombijem 8+1 ili spostvenim autom.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prijave na uros61017@its.edu.rs&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prilikom prijavljivanja poslati planinarsku biografiju i scan planinarske kartice najkasnije 4 dana do početka akcije.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Max broj planinara za ovu grupu je 35 + vodič.</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><br></p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\">NAPOMENA: Vodič zadržava pravo da ne povede na turu sve koji nemaju adekvatnu obuću i odeću za trek, kao i plaćenju članarinu za tekuću godinu. Ova tura nije za početnike i za one koji planinare a nisu u dobroj kondiciji.</span><br></p>', 'Kombi ili Sopstveni prevoz', 140, '3', 6, 15, 3, 1);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(8, 'Trodnevni aranžman raftinga na Tari 22km', 'rafting-tarom-thumbnailT.jpg', '3 dana raftinga na Tari u 3 reči: odmor, zabava, avantura.', '<p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Priuštite sebi dane nezaboravnog iskustva uz <b>SUMMIT EXPORERS</b>&nbsp;koje će nadmašiti i najviša očekivanja.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">Trodnevni aranžman raftinga na Tari</span>&nbsp;je fuzija lepote divlje prirode, adrenalinske avanture, lude zabave i vrhunske domaće hrane.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">Tara rafting trodnevna avantura</span>&nbsp;obuhvata 2 noćenja u komfornim planinskim bungalovima, 5 obroka pripremljenih od organski gajenih domaćih namirnica, po lokalnoj recepturi i rafting turu kroz najuzbudljivije delove&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">Tare i Drine</span>&nbsp;(Crna Gora-BiH).</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Uostalom, da li ste znali da tokom raftinga možete nesmetano vikati iz sveg glasa i nikome na čamcu neće smetati, jer će i oni raditi isto to?</p>', '<p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">1.DAN</span></p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Dolazak u naš kamp je u poslepodnevnim časovima. Nakon što se smestite i odmorite, sledi večera, a potom okupljanje i zabava. I budite spremni, jer to nije obična zabava, već jedna od onih žurki koja će vam razvući lice u smešak kada god je se setite. Muzika i druženje, upoznavanje novih ljudi, opuštanje i beg od svakodnevice do kasno u noć.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">2.DAN</span></p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">posle tradicionalnog planinskog doručka koji obnavlja energiju spremni smo da pokorimo i najveće brzake Tare i Drine. Svaki gost dobija svu potrebnu opremu za rafting i uputstva za njeno korišćenje i našim terenskim vozilima odlazimo na startno mesto spusta, Brštanovicu.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Sledi 3-5 sati ekstremne vožnje divljom planinskom rekom, pod sigurnim vođstvom iskusnih licenciranih (IRF) TARASPORT skipera.&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">Rafting</span>&nbsp;tura sprovodi se donjim tokom reka&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">Tare i Drine</span>, koji obiluju bukovima (oko 23) i predstavljaju vrhunski izazov za sve zavisnike od adrenalina i ljubitelje divljih voda. U toku spusta, pravićemo pauze za slikanje nestvarnih pejzaža, kupanje ispod divljih vodopada, razgledanje bajkovitih predela i beleženje uspomena koje menjaju pogled na život. Glasan smeh i vika, hladna voda koja ledi krv i smiruje ubrzani puls, opasnost koja lebdi u vazduhu i nadmudrivanje sa nesputanom rekom urezaće se duboko u sećanje svakog učesnika. Reč avantura posle&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">raftinga Tarom&nbsp;</span>dobija potpuno novo značenje.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Po završenom spustu, vraćamo se u kamp, puni utisaka i razdužujemo opremu. Potrošenu snagu vraćamo ukusnim ručkom u kome smo na najbolji način spojili tradiciju i prirodu , kako bi zadovoljili ukus i najvećih zaljubljenika u dobar zalogaj. Nakon ručka odmaramo, družimo se, a svakako ovo vreme možete sami upotpuniti nekom od naših mnogobrojnih&nbsp;ponuda (LINK).</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Na redu su večera i noćenje.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">3.DAN</span></p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Posle doručka&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">trodnevni aranžman rafting Tarom</span>&nbsp;se završava. Ali znamo da ćemo se videti ponovo, doći ćete vođeni željom za novim uzbuđenjem, jer postali ste kao i mi zauvek povezani sa ovom netaknutom prirodom i bistrim rekama. A Tara i Drina imaju još mnogo toga da vam pokažu. U zavisnosti od doba godine&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">rafting na Tari</span>&nbsp;može biti ekstremni izazov koji pomera lične limite ali i mirni spust i uživanje u svakom delu bistre gorske lepotice. Izaberite sami ili probajte oba.</p>', '<p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">U <b>SUMMIT EXPLORERS</b>&nbsp;centru negujemo&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">domaću, tradicionalnu kuhinju</span>&nbsp;kojom se stvara poseban osećaj dobrodošlice i prisnosti sa našim gostima. &nbsp;Sve namirnice koje vam nudimo proizvode se u neposrednoj okolini našeg kampa, na isti način na koji su to radili naši preci. Ovi predeli predstavljaju retku oazu netaknute prirode u Evropi, pa su proizvodi sa takvog područja nezagađeni i zdravi. Obroci su napravljeni od organski gajenog voća, povrća i mesa, koje su za nas odgajili lokalni seljani sa Durmitora, Maglića, Zelengore i obližnjih visoravni.&nbsp;</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Kombinacija ekološki čistih namirnica i starinski, tradicionalni način pripreme pravi su pokretači dobre energije. Priroda i tradicija ovde sa spajaju na najbolji način stvarajući ukuse koji će zadovoljiti i najprobirljivije gurmane i učiniti boravak u našem kampu nezaboravnim iskustvom.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Uz ukusne obroke nudimo vam i autentična pića ovog kraja. Raspoloženje će vam sigurno podići&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">domaće rakije</span>&nbsp;(šljivovica, kruškovača, jabukovača, dunjevača) i vina iz brojnih okolnih vinarija.</p><ul style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; line-height: 1.6; list-style-position: outside; font-family: Roboto, sans-serif; color: rgb(34, 34, 34); background-color: rgb(243, 246, 248);\"><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\">Na meniju za doručak, najčešće se nađu: uštipci, lepinje, šunka, domaći pršut, pečenica, jaja, kiselo mlijeko, med, livadski čajevi,slatko od sezonskog voća.</li><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\">Za ručak: pogačice, pite sa zeljem, hleb ispod saca,razne čorbe, Triftarski pasulj, sač sa telećim i jagnjećim mesom, jagnjece i praseće pecenje, salate.</li><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\">Za večeru: potočna pastrmka, kačamak, krompir ispod sača, jagnjeće pečenje, lovački gulaš, salate, sirevi, šunka i hercegovački pršut.</li><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\"><span style=\"font-weight: 700; line-height: inherit;\">Za desert: tulumbe, baklave, urmasice.&nbsp;</span></li></ul>', '<ul><li>Prethodno iskustvo nije potrebno</li><li>Minimalan broj osoba za realizaciju aranžmana je 5 osoba.</li><li>Maksimalan broj prijavljenih za ovaj aranžman je 10 osoba.</li></ul>', 'Autobus', 90, '2', 5, 10, 3, 7);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(9, 'Maglić (2386m)', 'maglicT.jpg', 'Uspon na najviši vrh u BiH', '<p style=\"text-align: left;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 603px;\" data-filename=\"maglic2.jpg\"><br></p><div style=\"text-align: left;\"></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif;\">Maglić (2.386m), Nacionalni park Sutijeska i Trnovačko jezero</strong></div><div style=\"text-align: left;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif;\"><br></strong></div><div style=\"text-align: left;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif;\"><span style=\"font-weight: 400;\">Vodimo vas u nacionalni park Sutjeska, koji je najstariji i najveći nacionalni park u BiH. Za njega kažu da je po svojim prirodnim vrednostima i lepotama biser Bosne i Hercegovine. U samom srcu parka smešten je i prirodni rezervat Perućica (1434 ha), najočuvanija i najveća prašuma u Evropi, u kojoj je od osnivanja nacionalnog parka strogo zabranjena bilo kakva intervencija čoveka. U sklopu naše trodnevne avanture, popećemo se na najviši vrh BiH, Maglić, kupati u smaragdnom Trnovačkom jezeru i uživati u netaknutoj prirodi.</span><br></strong><br></div><p></p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Program:</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan I:</b><br>Transfer od Beograda do Tjentišta :17.00-24.00<br>Nocenje</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan II:</b><br>7.00-8.00-Doručak<br>8.00-17.00- Priprema za uspon i uspon na Maglić<br>17.00-18.00-Odmor<br>18.00- večera i slobodno vreme</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><b>Dan III:</b><br>08.00-09.00 Doručak<br>09.00-13.00-Trek do Trnovačkog jezera<br>13.00-20.00-Povratak za Beograd</p>', '<p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Ukupni troškovi: 140&nbsp;€</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom obuhvaćeno:<br>-Prevoz Beograd – Tjentište – Beograd<br>-Prevoz do/od Prijevora<br>-Ulaz u NP Sutjeska<br>-Ulaz u park prirode Piva (Crna Gora)<br>-Licencirani UIAA vodič / prevoz, ishrana i smeštaj<br>-Smeštaj na bazi polupansiona</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Organizacijom nije obuhvaćeno:<br>-Osiguranje<br>-lična oprema<br>-ostali lični troškovi</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Oprema:&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Transportni ranac 50-70l, penjački ranac do 30l max, štapovi za hodanje, čeona lampa, rezervne baterije, naočare, čarape trekking, polar duks, gore-tex jakna, trekking pantalone, rukavice, kapa, marama – baf, cipele za trekking, krema za zaštitu od sunca, pribor za ličnu higijenu…</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Kondicioni nivo ture: 4/10</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Tehnički nivo ture: 1/10</p><p style=\"margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 18px; font-family: GothamLightRegular, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\">Prilikom prijavljivanja poslati planinarsku biografiju, scan planinarske kartice, scan potpisane izjave o rizicima i preuzimanju odgovornosti.</p>', '<p><span style=\"color: rgb(0, 0, 0); font-family: GothamLightRegular, Arial, Helvetica, sans-serif; font-size: 14px;\">Vodič zadržava pravo da ne povede na turu sve koji nemaju adekvatnu obuću i odeću za trek, odgovarajuće osiguranje, kao i plaćenju članarinu za tekuču godinu. Ova tura ima ukupno oko 10km penjanja i ukupnu visinsku razliku od 400m uspona i isto toliko silaska u jednom danu.</span><br></p>', 'Autobus, Beograd - Tjentište - Beograd', 140, '3', 4, 10, 3, 1);
INSERT INTO `aranzman` (`aranzmanId`, `naziv`, `thumbnailPhoto`, `kratakOpis`, `opis`, `planPuta`, `organizacija`, `napomene`, `prevoz`, `cena`, `zahtevnost`, `min_putnika`, `max_putnika`, `trajanjeDani`, `vrstaPutovanjaId`) VALUES
(10, 'Zip line iznad kanjona reke Tare', 'zip-line-thumbnailT.jpg', 'Doživite Najduži Zip Line u Evropi!', '<p><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; background-color: rgb(243, 246, 248);\">Većina ljudi koji su probali&nbsp;</span><span style=\"font-weight: 700; line-height: inherit; font-family: Roboto, sans-serif; color: rgb(33, 34, 39); font-size: 17px; background-color: rgb(243, 246, 248);\">zip line</span><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; background-color: rgb(243, 246, 248);\">&nbsp;reći će vam da se malo koji osećaj može meriti sa onim koji pruža let iznad duboke klisure uvijene u nepregledno zelenilo. <b>Summit Exlporers</b></span><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; background-color: rgb(243, 246, 248);\">&nbsp;vam daje mogućnost da upoznate Taru i najdublji kanjon Evrope iz novog ugla, sa najdužeg zip line u Evropi (dužina sajle je 1200m), kod Mosta na Đurđevića Tari.</span></p><p><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; text-align: justify; background-color: rgb(243, 246, 248);\">Ovaj petočasovni aranžman idealan je da u svoj odmor dodate malo adrenalina i obogatite ga za još jedno nezaboravno iskustvo. Stoga, ako ste ljubitelji divlje prirode i svežeg vazduha, &nbsp;zip line lako možete iskombinovati sa nekom od ostalih naših ponuda i kreirati odmor o kakvom ste maštali. Uzbuđenje, radost i osmesi su zagarantovani, pogotovo na licima naših najmlađih gostiju.</span></p><p><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; text-align: justify; background-color: rgb(243, 246, 248);\">Da li ste znali da je&nbsp;</span><span style=\"font-weight: 700; line-height: inherit; font-family: Roboto, sans-serif; color: rgb(33, 34, 39); font-size: 17px; text-align: justify; background-color: rgb(243, 246, 248);\">zip line</span><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; text-align: justify; background-color: rgb(243, 246, 248);\">&nbsp;najbezbedniji i ujedno najuzbudljiviji način da prevaziđete strah od visine?</span><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; text-align: justify; background-color: rgb(243, 246, 248);\"><br></span><span style=\"color: rgb(33, 34, 39); font-family: Roboto, sans-serif; font-size: 17px; background-color: rgb(243, 246, 248);\"><br></span><br></p>', '<ul style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; line-height: 1.6; list-style-position: outside; font-family: Roboto, sans-serif; color: rgb(34, 34, 34); background-color: rgb(243, 246, 248);\"><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\"><span style=\"font-weight: 700; line-height: inherit;\">Vreme polaska:</span>&nbsp;10:00 i 14:00</li><li class=\"rtejustify\" style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39); text-align: justify;\"><span style=\"font-weight: 700; line-height: inherit;\">Trajanje ture:</span>&nbsp;3 minuta vožnja na sajli (moguće ponavljati više puta)</li></ul><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\">Uzbudljivi izlet započinje dolaskom u naš kamp u jutarnjim satima, odakle ćemo se našim terenskim vozilima prevesti do Žabljaka, gde se nalazi Most na Đurđevića Tari.&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">U toku vožnje prolazićemo kroz nestvarne prirodne kreacije Pivsko jezero</span>, Pivske planine, Durmitor. Ovi planinski biseri sigurno će vam oduzeti dah svojom autentičnom lepotom i poželećete da ponesete jedan delić sa sobom makar na fotografijama.</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">Po dolasku na Most na Đurđevića Tari</span>, avantura vožnje sajlom s jednog kraja brda na drugi može da počne. Sam let traje oko 3 minuta, ali ga možete ponavljati koliko god puta poželite (uz doplatu).</p><p class=\"rtejustify\" style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; font-family: Roboto, sans-serif; font-size: 17px; line-height: 27px; text-rendering: optimizelegibility; color: rgb(33, 34, 39); text-align: justify; background-color: rgb(243, 246, 248);\"><span style=\"font-weight: 700; line-height: inherit;\">Dok letite čvrsto pričvršćeni za sajlu</span>, ispod vas puca pogled na zelene šume i pašnjake i duboki tirkizni&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">kanjon Tare</span>. Sa svakim metrom adrenalin raste, a lice se razvlači u široki osmeh koji neće silaziti danima. Panoramski prizor sa 200m visine urezaće vam se duboko u sećanje i osloboditi stresa svaki deo vašeg bića.</p>', '<ul style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; line-height: 1.6; list-style-position: outside; font-family: Roboto, sans-serif; color: rgb(34, 34, 34); background-color: rgb(243, 246, 248);\"><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\">Prethodno iskustvo nije potrebno</li><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\">Minimalan broj učesnika za realizaciju aranžmana je 4 osobe ili se možete priključiti postojećoj grupi</li><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\">Na gupne posete ostvarujete popust od 10%</li><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\">Za decu do 12 god. cena aranžmana je umanjena za 30%.</li><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\">Satnice u opisu aranžmana nisu fiksne i mogu se menjati zavisno od želje i potreba gostiju.</li><li style=\"margin: 0px; padding: 0px; font-size: 17px; line-height: 27px; color: rgb(33, 34, 39);\"><span style=\"font-weight: 700; line-height: inherit;\">Ovaj aranžman se po dogovoru može kombinovati &nbsp;ili produžiti sa drugim aranžmanima.</span></li></ul>', '<p><font color=\"#0000ff\">Ponuda uključuje:</font></p><ul><li><span style=\"color: rgb(33, 34, 39); font-size: 17px; font-family: Roboto, sans-serif;\">Jedna aktivnost - zip line, vodič i transport učesnika našim terenskim vozilima u toku trajanja aranžmana</span></li><li><span style=\"color: rgb(33, 34, 39); font-size: 17px; font-family: Roboto, sans-serif;\">Besplatan parking za Vaša vozila u baznom kampu,</span></li><li><span style=\"color: rgb(33, 34, 39); font-size: 17px; font-family: Roboto, sans-serif;\">Besplatan Full HD snimak vaše avanture snimljen Go Pro kamerama</span></li></ul>', 'Autobus', 45, '1', 4, 12, 1, 4),
(11, 'Zip line iznad kanjona reke Tare1', '3-Tribuca-6T.jpg', 'Avantura na', '<p>asdfdsafasdfasdfasdfsadfasfsdafasdfsadfasdfasfasfasfsa</p>', '<p>asdf</p>', '<p>fdsafsadfasdfsadfsadfsadfsfadsfasdfadsfsad</p>', '<p>fsafasdfsadfasdfsadfasfas</p>', 'Autobus', 45, '2', 4, 8, 1, 2);

