(1, 'Crno-plave polarizovane naočare za planinarenje mh570 4. kategorije, za odrasle', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"><span style=\"font-family: Arial;\">﻿Crno-plave polarizovane naočare za planinarenje mh570 4. kategorije, za odrasle.</span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"><span style=\"font-family: Arial;\"><br></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"></p><h4><span style=\"font-family: Arial;\"><b>Benefiti</b></span></h4><h4><span style=\"font-family: Arial;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">POKROV</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Okrugli oblik: štiti oči od vetra, prskanja i lošeg vremena.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">ZAŠTITA OD SUNCA</h3><p></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Sočiva 4. kat. – 100% UV filter: savršeno za jako sunce ili velike visine.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VIDNO POLJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Velika sočiva za bolji periferni vid.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">STABILNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Vrhovi drški od fleksibilnog materijala: drže naočare na mestu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Samo 28 g.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZDRŽLJIVOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Sočiva od polikarbonatne plastike visoke čvrstoće.Garancija od 2 godine.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KOMPATIBILNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Perforirani vrhovi drški: kompatibilne sa remenom MH ACC 500.</span><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">SOČIVA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Četvrta kategorija: propušta od 3% do 8% svetla (zaštita po sunčanom vremenu - Standard: ISO 12312-1).</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">100% ANTI-UV filter.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Materijal: polikarbonat otporan na udarce. Oblik: sferični oblik – Baza 8.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">RAM</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Tip rama: puni.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Materijal rama: poliamid i guma.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Materijal umetka za nos: poliamid i guma.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Materijal drški: poliamid i guma.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Materijal vrhova drški: poliamid i guma.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Veličina: pogodno za srednje široka i široka lica.</span></p>', 29, 25, 20, 'crno-plave-polarizovane-naocare-za-planinarenje-mh570-4-kategorije-za-odrasleT.jpg', 1),
(2, 'Sivo-plavi štap za planinarenje forclaz 500', '<p><span style=\"font-family: Tahoma;\">﻿Sivo-plavi štap za planinarenje forclaz 500</span></p><p><br></p><h4><b>Benefiti</b></h4><h4><b><br></b></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">ERGONOMSKO DRŽANJE</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Duža drška od pene visoke gustine radi boljeg držanja u ruci na nagibima.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Težina: 265 g.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZDRŽLJIVOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Garancija: dve godine.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Izdržljivi šiljak (volfram karbid).</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PODESIV</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Sistem unutrašnjeg podešavanja vijcima.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Dužina: 63 cm – 130 cm.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KOMPAKTNOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Tri dela.Dužina (sklopljeno): 63 cm.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Dužina (rasklopljeno): 130 cm.</span><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span><b><br></b></h4><p><br></p><p><br></p><p><br></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KAKO PODESITI ŠTAP?</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Držite štapove pod pravim uglom u odnosu na ruku. Podešavanje: odvrnite srednji deo ispod prstena donjeg dela, podesite na željenu visinu (u cm) i čvrsto zategnite, ali ne prečvrsto. Uradite isto sa donjim delom. NIKAD NE PRELAZITE „STOP LINE\", inače se štap može polomiti tokom upotrebe.</span><br></p><div class=\"row\" style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><div class=\"col-lg-12 col-md-12\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 1140px;\"><hr></div></div><div class=\"row\" style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><div class=\"col-lg-4 col-md-4\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 379.984px;\"><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UPUTSTVO ZA UPOTREBU</h3></div></div><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none; font-size: 1rem;\">Pre nego što krenete:uvek proverite da li su štapovi dobro zategnuti.</span><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none; font-size: 1rem;\">Pri spuštanju nizbrdo ili pri snažnim pritiscima na planini možete podesiti štapove na veću dužinu.&nbsp;</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none; font-size: 1rem;\">Pri usponu možete koristiti traku za ručni zglob kao podršku, ali pri hodu nizbrdo je bolje da je skinete da vam štapovi ne bi smetali pri eventualnom padu.</span></p><div class=\"row\" style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><div class=\"col-lg-12 col-md-12\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 1140px;\"><hr></div></div><div class=\"row\" style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><div class=\"col-lg-4 col-md-4\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 379.984px;\"><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PRIBOR</h3><p style=\"box-sizing: inherit; font-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Priložene odvojive letne krplje (malog prečnika).&nbsp;</span><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kompatibilno sa širim zimskim krpljama.</span></p><p style=\"box-sizing: inherit; font-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p></div></div><div class=\"col-lg-8 col-md-8\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 760px; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></div><div class=\"col-lg-8 col-md-8\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 760px; color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></div>', 19, 21, 0, 'sivo-plavi-stap-za-planinarenje-forclaz-500T.jpg', 2),
(4, 'Plava čeona lampa trek 500', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"><span style=\"font-family: Arial;\">﻿</span><font face=\"Arial\">Plava čeona lampa trek 500</font></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"><span style=\"font-family: Arial;\"><br></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; line-height: 1.1;\"></p><h4><span style=\"font-family: Arial;\"><span style=\"font-weight: bolder;\">Benefiti</span></span></h4><h4><span style=\"font-family: Arial;\"><span style=\"font-weight: bolder;\"><br></span></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VIZUELNA EFIKASNOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Široki snop dometa od 60 metara (200 lm): savršeno za šetnje i logorovanje.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OTPORNOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Otporna na udarce i prskanje (IPX5).</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KOMPAKTNOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Iz jednog dela, lako se pakuje u džep ili ranac.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">90 g</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">AUTONOMIJA</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">30 h u eko, 8 h u običnom, 3 h u snažnom načinu. Mikro USB punjiva baterija.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">POLIVALENTNOST</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">5 načina rasvete: crveni, eko, standard, snažno i trepćuće.</span></h4><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\"><br></span></h4><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVAN ZA KORIŠĆENJE</h3><h4><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif; font-size: 16px;\">Dva ergonomska dugmeta. Prilagodljiv kaiš koji se pere. Sistem zaključavanja.</span><span style=\"font-family: Arial;\"><span style=\"font-weight: bolder;\"><br></span></span></h4>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">NAČIN RASVETE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Čeona lampa TREK 500 ima pet funkcija za različite situacije:</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">- crveno svetlo za skrivanje ili za gledanje u mraku - eko svetlo (20 lm) za čitanje mapa ili kretanje kampom - obično svetlo (80 lm) za šetanje stazama ili šumskim putevima - snažno svetlo (200 lm) za hodanje po neravnom terenu - jako svetlo (lm) za pronalaženje neoznačenih staza - trepćuće svetlo za signalizaciju. Automatski način štednje baterije, 25 lumena uz garantovanih sat vremena rada.</span><br></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VRSTA BATERIJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Odvojiva 1800mAH litijum-jonska baterija koja se može puniti preko mikro USB kabla (priložen) i kompatibilna je sa eksternim punjačima i solarnim panelima FORCLAZ.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Vreme punjenja od 2 do 2,5 sata.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OPTIČKI SNOP</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Široki snop lampe ONNIGHT 500 ravnomerno se raspršuje, tako da možete jasno da vidite ispred sebe i sa strane.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">RASVETNA TEHNOLOGIJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Stalno LED osvetljenje: efekat osvetljenja se pražnjenjem baterije ne smanjuje.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">SASTAV</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Konstrukcija iz jednog dela za uštedu prostora.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kućište ABS sa podesivim uglom osvetljenja i gumenom zaštitom od udaraca.Čeona lampa se može zaključati (dugi pritisak na dva dugmeta), kako biste sprečili nehotimično uključivanje u rancu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">TEŽINA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">90 g.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">DIMENZIJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">62 x 41 x 35 mm (bez trake).</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">TRAKA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Traka se može skinuti i oprati.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Sastav: 70 % poliester i 30 % prirodna guma za maksimalnu udobnost.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Dve simetrične kopče za lakše pričvršćivanje.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Čeona lampa FORCLAZ TREK 900 se prilagođava svim veličinama glave, odraslim i dečjim, kao i planinarskim kacigama.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p>', 9, 20, 15, 'plava-ceona-lampa-trek-500-200T.jpg', 4),
(5, 'Ručna lampa i punjač dynamo 900 (150 lumena)', '<p>Ručna lampa i punjač dynamo 900 (150 lumena). Proizvođač: FORCLAZ</p><p><br></p><h3>Benefiti</h3><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VIZUELNA EFIKASNOST</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Široki snop dometa od 40 metara (150 lumena)</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OTPORNOST</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Otporna na prskanje vodom (IPX4) i udarce</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KOMPAKTNOST</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Staje u ranac</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVAN ZA KORIŠĆENJE</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Ručka za jednostavno držanje i dugme koje se može koristiti i sa rukavicama</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">AUTONOMIJA</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">USB-om: 2 h u eko načinu, 1 h u snažnom. Dinamom: 5 min. za 1 min okretanja.</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">POLIVALENTNOST</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">3 funkcije za sve vaše potrebe + funkcija USB punjenja od 1200 mAh</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">120 g</span><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">NAČIN RASVETE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">3 funkcije za sve vaše potrebe:</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">slabo svetlo (75 lm) - za veću autonomiju</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">snažno svetlo (150 lm) - za daljinu</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">treptuće svetlo (200 lm) - za signalizaciju lokacije</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VRSTA BATERIJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Unutrašnja Li-Po baterija koja se može napuniti preko USB-a ili dinama.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Standardna USB utičnica, tako da lampu možete koristiti i kao rezervni punjač za telefon ili elektronsku opremu.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kapacitet baterije: 1200 mAh.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OPTIČKI SNOP</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Široki snop za optimizovanje snage za dobar raspon i širok pogled.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">RASVETNA TEHNOLOGIJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Standardno LED osvetljenje: efekat osvetljenja se postupnim pražnjenjem baterije smanjuje, da bi baterija duže trajala.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">SASTAV</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Plastično kućište sa zaštitom sočiva i gumenim vrhom za ublažavanje udaraca.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">TEŽINA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">120 g.</span></p>', 7, 18, 30, 'rucna-lampa-i-punjac-dynamo-900-150-lumenaT.jpg', 4),
(6, 'Plava bočica od tritana 900 za planinarenje sa slamkom (0,5 litara)', '<p>Plava bočica od tritana 900 za planinarenje sa slamkom (0,5 litara)</p><p><br></p><h4>BENEFITI</h4><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVNO OTVARANJE / ZATVARANJE</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Jednostavno otvaranje i zatvaranje jednom rukom, slamka je ugrađena u čep.</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVAN ZA KORIŠĆENJE</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Slamka za ispijanje, široki otvor, ručka, skala za merenje. 0,5 l.</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZDRŽLJIVOST</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Od tritana: prozirna plastika, otporna na lom, ne ostavlja ukus.</span></p><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZOTERMALAN</h3><p><span style=\"color: rgb(36, 35, 35); font-family: Roboto, sans-serif;\">Nije izotermalna. Za održavanje svežine koristite izotermalnu navlaku od 0,6 l.</span><br></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UPUTSTVO ZA UPOTREBU</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Tritan nije izotermalan. Upotrebite navlaku ako želite održati svežinu napitaka.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Ne koristiti za gazirana pića ili masne tečnosti (mlečne proizvode, ulja, itd.). Ne stavljati u mikrotalasnu pećnicu niti u zamrzivač.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Bočica je prozirna i ima skalu za merenje do 200 ml kako biste mogli videti količinu preostale tečnosti ili pripremiti energetske napitke.</span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></h3><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KARAKTERISTIKE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Uspravno ispijanje pomoću slamke bez naginjanja glave.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Ako sklonite slamku, možete piti kao iz obične boce. Međutim, to može prouzrokovati buku (zvuk patke ili delfina) zbog vazduha koji dolazi u kontakt sa vodom.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Na čepu se nalazi ručka tako da se lako može nositi u ruci ili okačiti na ranac pomoću kaiša ili kuke.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UPUTSTVA ZA ODRŽAVANJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Nakon svake upotrebe bocu operite tečnošću za pranje suđa i vodom. Proizvod se po potrebi može staviti i u mašinu za pranje sudova. Prilikom pranja u mašini za pranje sudova može se skinuti navoj sa čepa. Ako se to dogodi, ponovo ga namestite kako bi nepropusnost vaše bočice bila zagarantovana. Bočicu i čep odvojeno dobro osušite.</span></p>', 37, 9, 0, 'plava-bocica-od-tritana-900-za-planinarenje-sa-slamkom-05-litaraT.jpg', 5);
INSERT INTO `proizvod` (`proizvodId`, `naziv`, `opis`, `tehnickeInfo`, `kolicina`, `cena`, `popust`, `thumbnailPhoto`, `vrstaProizvodaId`) VALUES
(7, 'Narandžasti dvogled za planinarenje mh b100 za decu sa povećanjem do 6', '<p>Narandžasti dvogled za planinarenje mh b100 za decu sa povećanjem do 6</p><p><br></p><h4>BENEFITI</h4><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">POVEĆANJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Povećanje posmatranih objekata do 6 puta. Prečnik objektiva = 25 mm.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PODESIV</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Bez podešavanja. Oštra slika od minimalno 20 m.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVNO PRENOŠENJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Podesiva traka za nošenje oko vrata.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Samo 208 g.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZDRŽLJIVOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Silikon osigurava dobru otpornost na udarce i odlično prianjanje.</span></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OPTIČKI KVALITET</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Prizme i sočiva od kvalitetnog mineralnog stakla K9.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Sočiva od mineralnog stakla kvaliteta K9.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OŠTRINA SLIKE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Sistem Fix Focus: nije potrebno podešavanje, fokus je unapred podešen za posmatranje na udaljenosti od oko 20 m.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Zbog sistema podešavanja Fix Focus, morate da nosite vaše dioptrijske naočare, ako ih nosite, kako biste dobili jasnu sliku.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Idealan za posmatranja sa kratkih i srednjih udaljenosti, a zbog jednostavne upotrebe, naročito je pogodan za decu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PODEŠAVANJE ZA ONE KOJI NOSE NAOČARE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Zbog sistema bez podešavanja Fix Focus, potrebno je da zadržite vaše dioptrijske naočare, kako biste dobili jasnu sliku.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">U tom slučaju, dovoljno je skinuti gumenu kapicu kako biste mogli prisloniti naočare na objektive bez opasnosti od oštećenja</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UDOBNOST I TRAJNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Odlično prianjanje i udobnost zahvaljujući silikonskoj oblozi.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Silikon osigurava dobru otpornost na udarce i odlično prianjanje.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">DODACI</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Isporučuje se uz traku za nošenje oko vrata sa sigurnosnom kopčom.</span></p>', 38, 20, 30, 'narandzasti-dvogled-za-planinarenje-mh-b100-za-decu-sa-povecanjem-do-6T.jpg', 3),
(8, 'Kompas za orijentisanje 50 s kopčom - crni', '<p>Kompas za orijentisanje 50 s kopčom - crni</p><p>To je najjednostavniji i najvažniji kompas: njegova jedina svrha je da pronađe sever. Praktičan i lagan, možete ga prikačiti bilo gde.</p><p><br></p><h4>BENEFITI</h4><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PRECIZNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kompas sa preciznom i brzom univerzalnom iglom</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Lagani aluminijumski kompas: Težak je svega 16 g!</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVNO PRENOŠENJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Prikačite kompas na torbu pomoću kopče!</span></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">PROVERITE DA KOMPAS STOJI RAVNO PRE UPOTREBE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Vaš kompas mora da bude ravan da bi ispravno mogao da pokazuje sever. Na primer, stavite kompas na dlan. Kada koristite mapu stavite kompas na mapu na ravnu površinu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">ŠTA AKO KOMPAS IZGUBI SVOJU FUNKCIJU?</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Koristite kompas daleko od izvora magnetnog polja inače bi mogao da izgubi svoju funkciju: električni vodovi visoke voltaže, mobilni telefoni, ključevi, metalni predmeti itd. Čak i drugi kompas može da utiče na pokazivanje smera!</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVAN I POUZDAN</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">To nije igračka! Pouzdan je poput vrhunskih kompasa. Razlika u odnosu na druge kompase iste kategorije leži u dodatnim karakteristikama: veličini pokazivača, čitljivosti i brzini.</span></p>', 30, 7, 0, 'kompas-za-orijentisanje-50-s-kopcom-narandzastiT.jpg', 6),
(9, 'Kompas za orijentisanje racer 900 za levi palac - crni', '<p>Kompas za orijentisanje racer 900 za levi palac - crni</p><p><br></p><p>Ovaj kompas je namenjen za orijentisanje&nbsp; za korisnike koji skreću sa utabanih staza, povlače se među drvećem i za koje je svaka sekunda bitna.</p><p><br></p><h4>BENEFITI</h4><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UDOBNOST KORISNIKA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Držač protiv klizanja za mapu i udobnost za palac.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">BRZINA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Povećana brzina zahvaljujući snazi magneta.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">STABILNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Disk i tehnologija snažnog duplog magneta.</span></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">IZUZETNA STABILNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">S našim tehničkim partnerom, Nikolasom Riom, razvili smo matematički model da bismo ponudili najbolju kombinaciju stabilnosti i pouzdanosti za kompas.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">BRZ KAO MUNJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Povećali smo brzinu igle kada menjate smer, a zadržali smo stabilnost zahvaljujući dugačkom i super snažnom magnetu.</span></p>', 50, 45, 20, 'kompas-za-orijentisanje-racer-900-za-levi-palac-crniT.jpg', 6),
(10, 'Crni ranac za planinarenje mh500 (40 l)', '<p>Crni ranac za planinarenje mh500 (40 l)</p><p><br></p><h4>BENEFITI</h4><p><br></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">UDOBNOST NOŠENJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Leđni deo od mrežastog materijala. Obložene naramenice i pojas. Petlje</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">SADRŽAJ</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">40 l. Dimenzije: 66 cm x 30&nbsp;cm x 26 cm. Pogodan za lični prtljag.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">ZAŠTITA SADRŽAJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Premazan vodootporan materijal i ušivena navlaka za kišu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LAGANO</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">40 l: samo 1260 g u veličini S i 1390 g u veličini L.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VENTILACIJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Prozračan sa leđnim delom od mrežastog materijala za bolje regulisanje vlage.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">VIŠE ODELJAKA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Devet džepova, od njih dva za brzi dostup do Meha, 2 džepa na pojasu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">JEDNOSTAVNO OTVARANJE / ZATVARANJE</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Bočno otvaranje na rajsferšlus za pristup glavnoj pregradi ranca.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">OTPORNOST</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Garancija od 10 godina</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><br></p>', '<h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">GARANCIJA OD 10 GODINA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Važna nam je otpornost na trenje, kako bi ranac bio izdržljiv. Istraživačko-razvojni sektor, partner Quechue za istraživanje i testiranje materijala i šivanja, provodi testiranja (materijala, šavova i konačnog proizvoda) koja simuliraju starenje ranca. Na osnovu rezultata ovih testova, Quechua i Dechatlon na testirane rance mogu dati garanciju od 10 godina od datuma kupovine navedenog na računu.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">NEMOJTE BACATI PROIZVOD, POPRAVITE GA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Ovaj proizvod možete da uzmete na sve svoje izlete u planine.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kako vi napredujete, oni stare. Neki delovi mogu se istrošiti ili slomiti. Kako bi popravka bila lakša, nudimo kopče za zatezanje i ostale delove na odeljenju \"Dodaci za rance/planinarenje\". Nemojte bacati proizvod, popravite ga.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">HIDRATACIJA</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Ranac ima 1 l, 2 l ili 3 l džep. Iako su džepovi veći, oni će zauzeti prostor, u kojeg biste mogli spremiti druge stvari. Bočni džepovi su dizajnirani za flašice od najviše 1 l.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">ZAŠTO SU KIŠNE PRESVLAKE RANCA NARANDŽASTE BOJE?</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Radi se o namernom rešenju, jer smatramo da je važno da ostanete vidljivi u planinama, čak i u magli. Prednost narandžaste boje je da ćete biti vidljivi i iz helikoptera.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Takođe ćete biti vidljivi i na cesti ako ranac uzmete na vožnju biciklom.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">LIČNI PRTLJAG</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Ako putujete avionom, maksimalne dimenzije ličnog prtljaga su 55 x 35 x 25 cm (dimenzije se mogu razlikovati ovisno o avio-kompaniji).</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Stoga možete ranac upotrebljavati i kao lični prtljag</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KAKO DA SPAKUJETE SVOJ RANAC?</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Na dno ranca spakujte vreću za spavanje i teže stvari. Meh za vodu stavite u odeljak za vodu.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Na vrhu spakujte vodootpornu jaknu i flis.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">U džepove spakujte kremu za sunčanje, karte, kapu i naočare za sunce. Žitne pločice i telefon možete staviti u džepove pojasa, gde će biti brzo dostupni.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">Kaiševe ispod ranca možete upotrebiti i za pričvršćavanje kompaktnog šatora.</span></p><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><br></span></p><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">KAKO PODESITI RANAC?</h3><p style=\"box-sizing: inherit; font-family: Roboto, sans-serif; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">1. Olabavite kaiševe: naramenice, kaiš u pojasu, kaiševe za podešavanje (manji kaiševi iznad naramenica).</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">2. Stavite ranac na ramena.</span><br style=\"box-sizing: inherit; color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\"><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">3. Zakopčajte kaiš ranca tako da ga namestite na kukove i zategnete sve dok ne stoji čvrsto na mestu.</span><span style=\"color: rgb(36, 35, 35); font-weight: 400; text-transform: none;\">4. Zategnite naramenice ranca. 5. Zategnite kaiš na prsima (ne previše da ne bi imali poteškoća s disanjem). 6. Podesite kaiševe za podešavanje opterećenja (ranac će se priljubiti uz ramena).</span></p>', 26, 75, 10, 'crni-ranac-za-planinarenje-mh500-40-lT.jpg', 7),
