ont-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\">NAŠ EKOLOŠKI PRISTUP</h3></div><div class=\"col-lg-8 col-md-8\" style=\"box-sizing: inherit; min-height: 1px; float: left; width: 760px;\">Kako smo svesni da moramo očuvati našu planetu, Quechua se obavezala da će ograničiti uticaj na životnu sredinu. Danas ovaj proizvod još&nbsp;<span style=\"font-size: 1rem;\">nema ekološki dizajn, ali već radimo na tome: ekološki dizajn, mogućnost popravke i održivi razvoj su jezgro našeg razvoja.</span><span style=\"color: rgb(78, 78, 78); font-family: Arial; text-transform: uppercase; font-size: 1rem;\">﻿</span></div></div></div><h3 class=\"h3\" style=\"box-sizing: inherit; font-family: inherit; font-weight: 700; line-height: 1.1; color: rgb(78, 78, 78); font-size: 16px; text-transform: uppercase;\"><div class=\"row\" style=\"box-sizing: inherit;\"><div class=\"row\" style=\"box-sizing: inherit;\"><div><br></div></div></div></h3>', 25, 45, 0, 'plavi-dvogled-za-planinarenje-mh-b-140-za-odrasle-sa-povecanjem-do-10T.avif', 3);

