INSERT INTO `vrsta_putovanja` (`vrstaPutovanjaId`, `naziv`, `thumbnailPhoto`, `opis`) VALUES
(1, 'Planinarska tura - Trekking, Hiking', 'hiking-and-trekking1T.jpg', '<p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Muli; color: rgb(33, 33, 33); line-height: 24px; padding-bottom: 20px;\">Hiking i Trekking podrazumevaju pešačenje u prirodi, istu neophodnu opremu i napornu fizičku aktivnost ali razlike između dva pojma ipak postoje.&nbsp;<span style=\"font-weight: 700;\">Hiking&nbsp;</span>se više odnosi na pešačenje poznatim predelima , uređenim planinarskim stazama i adekvatnim smeštajem na stazi. Uglavnom se odnosi na kraće ture koje možete da odradite za vikend, kao i da sa vašim automobilom priđete početnoj tački sa koje krećete na pešačenje.</p><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Muli; color: rgb(33, 33, 33); line-height: 24px; padding-bottom: 20px;\"><span style=\"font-weight: 700;\">Trekking</span>&nbsp;se odnosi na višednevna pešačenja u planinskim predelima ili jednostavnije rečeno to je planinarenje. Za trekking vam je potrebno nešto dodatne opreme u odnosu na hiking jer ste duže u planini i prelazite veće distance na dnevnom nivou.</p>'),
(2, 'Kajaking', 'kajakingT.jpg', 'Kajaking je jedna od najlepših aktivnosti na vodi koja vam donosi nalet pozitivne energije, bez obzira da li veslate rečnim rukavcima, brzacima, na jezeru, niz vodopade ili na moru. To je sjajan način da se približite prirodi i sagledate svet oko sebe, tiho se krećući kroz ušuškane pejzaže i posmatrajući prizore koje mnogi ljudi nikada neće uživo videti. Nije ni čudo što su kajaci popularni širom sveta.'),
(3, 'Kanjoning', 'kanjoningT.jpg', 'Kanjoning je sportska aktivnost koja podrazumeva prolazak kroz kanjone savladavanjem negostoljubivih prirodnih prepreka (vodopada, prirodnih bazena, tesnih stenovitih grla) koje pravi reka probijajući se kroz uske planinske klisure.'),
(4, 'Zip Line', 'zip-lineT.jpg', '<p><span style=\"font-weight: 700; color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">Zip line</span><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">&nbsp;avantura je veoma popularna poslednjih godina, ali nije uvek služila kao&nbsp;</span><span style=\"font-weight: 700; color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">vid adrenalina i zabave</span><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">. Funkcija i uloga zipline-a se vremenom razvila od brzog načina prevoza, preko naučnoistraživačkog alata, do zaštitnog znaka avanturističkog turizma.</span></p><p><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\"><br></span></p><h2><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">Šta je Zip Line?</span></h2><p><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\">Zip line je zamišljen kao adrenalinska avantura prelaska sa jedne tačke do druge „leteći“ kroz vazduh prikačen na sigurnosnu sajlu.</span></p><p><span style=\"font-weight: 700; color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; font-size: 18px; font-style: italic; letter-spacing: 0.2px; text-align: justify;\">Zip line se nekada koristio za prevoz ljudi i hrane</span><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; font-size: 18px; font-style: italic; letter-spacing: 0.2px; text-align: justify;\">&nbsp;preko reka i nepristupačnih terena, tamo gde nije bilo moguće izgraditi most ili drugi prilaz. Danas se zip line najviše koristi u&nbsp;</span><span style=\"font-weight: 700; color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; font-size: 18px; font-style: italic; letter-spacing: 0.2px; text-align: justify;\">adrenalinsko-zabavne svrhe.</span><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\"><br></span><span style=\"color: rgb(0, 0, 128); font-family: &quot;Hind Siliguri&quot;, sans-serif; letter-spacing: 0.2px; text-align: justify;\"><br></span><br></p>'),
(7, 'Rafting', 'raftingVrstaPutovanjaT.jpg', '<p><em style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px; text-align: justify;\"><b>Splavarenje </b>ili popularno <b>rafting</b>, vrsta je sporta, obično na reci, gde se grupa ljudi (između 4 i 10) spušta gumenim čamcem niz rečne brzake sa ciljem uzbuđenja, avanture i druženja. Spada u grupu modernih ekstremnih sportova. Rafting (“raft” na engleskom znači “splav”) je, iako spada u grupu ekstremnih sportova, prvenstveno vid sportske rekreacije. Čamci (“gumenjaci” ili “raft”) za rafting napravljeni su od izuzetno otporne višeslojne gume i imaju više odvojenih vazdušnih komora. Dužina splava je između 3 i 6 metara. U većini slučajeva raft ima i kormilara (“skipera”), koji sedi na krmi rafta i kormilom ili, češće, veslom, upravlja i navodi raft kroz rečne brzake. Svaki putnik u raftu (“rafter”) opremljen je veslom, zaštitnim plutajućim prslukom i kacigom. Precizne instrukcije daju se početnicima, obično turistima, kojih se ovi moraju striktno pridržavati za vreme raftinga.</em></p><h2 style=\"font-family: Verdana, Geneva, sans-serif; line-height: 1.1; color: rgb(34, 34, 34); margin-top: 20px; margin-bottom: 10px; font-size: 30px; font-style: italic; text-align: justify;\">Tara Rafting</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px; font-style: italic; text-align: justify;\"><span style=\"font-weight: 700;\">Kanjon reke Tare</span>&nbsp;je dugačak 82 kilometra i sa dubinom od 1300 metara je najdublji u Evropi, a drugi u svetu, odmah iza kanjona reke Kolorado. Kanjon pripada Nacionalnom Parku Durmitor i pod zaštitom je UNESCO-a. Reka Tara seče kanjon. Kanjon je deo Tara Rafting rute. Od Brstanovica do Šćepan Polja rafting tura traje od 2 do 3 časa i dugačka je 18 kilometara. Ovaj deo reke je najuzbudljiviji jer reka ima najveći pad na najmanjoj dužini. Na tom delu se nalazi 21 brzak od ukupno 50, koliko ih ima na reci Tari. - \"Wiki\"</p><p><br></p>');

